  true,\n\t\"url\": null,\n\t\"notes\": \"Dataset presents concentrations of organic
  pollutants, such as polyaromatic hydrocarbon compounds, in water samples. Water
  samples of known volume and concentration were allowed to equilibrate with known
  mass of nanoparticles. The mixture was then ultracentrifuged and sampled for analysis.
  \  nnThis dataset is associated with the following publication:nSahle-Demessie,
  E., A. Zhao, C. Han, B. Hann, and H. Grecsek. Interaction of engineered nanomaterials
  with hydrophobic organic pollutants..   Journal of Nanotechnology. Hindawi Publishing
